        this.state = {}
    }

    componentDidMount(){

    }

    readArticle = () => {

        var title = this.props.match.params.article

        nTitle = title.re

        axios.get(`${KONEKSI}/read/`)
        .then((res) => {
            console.log(res)
        })

    }


    render() {

        return (
            <div>
